import './Main.css';
import App from './App';
import { Link } from 'react-router-dom';

function Main(){
    return(
        <App>
            <div>
            <Link to="Chatbox">
            <img src="logoHOme.png" />
            </Link>
            </div>
        </App>
    )
}

export default Main;
